INSERT INTO `projects` (`id`, `post_by`, `proj_name`, `proj_area`, `thumbnail`, `proj_type`, `proj_slug`, `proj_est_price`, `status`, `bed_room`, `bath_room`, `stories`, `fence`, `roof`, `proj_description`, `created_at`, `updated_at`) VALUES
(1, 1, 'Project 1', '50', 'thumbnail_1673174973.jpg', 1, 'project-1', 600000, 'active', 1, 1, 1, NULL, NULL, 'This design may serve as inspiration for individuals looking for one-bedroom single-story home designs. The wonderful little house with one bedroom and a flat roof is today\'s featured home. If the base is strong enough to support a roof deck, the flat roof can be changed into one (if your budget allows for it). The total area of this house is 50 square meters. It is a great size for a one-bedroom house.', '2023-01-03 23:48:53', '2023-01-08 11:34:27'),
(2, 1, 'Project 2', '50', 'thumbnail_1672821004.jpg', 1, 'project-2', 650000, 'active', 2, 1, 1, NULL, NULL, 'A floor plan is a drawing or a visual representation of a home’s interior from above. It shows the placement of walls and includes key elements of the house like doors, windows, stairs, and furniture. It also communicates the room names and sizes, as well as the dimensions between walls.\r\nNote - Total Square Footage typically only includes conditioned space and does not include garages, porches, bonus rooms, or decks', '2023-01-04 00:28:49', '2023-01-08 11:35:45'),
(3, 1, 'Project 3', '50', 'thumbnail_1672823337.jpg', 1, 'project-3', 675000, 'active', 2, 2, 1, NULL, NULL, 'A floor plan is a drawing or a visual representation of a home’s interior from above. It shows the placement of walls and includes key elements of the house like doors, windows, stairs, and furniture. It also communicates the room names and sizes, as well as the dimensions between walls.\r\nNote - Total Square Footage typically only includes conditioned space and does not include garages, porches, bonus rooms, or decks', '2023-01-04 01:08:11', '2023-01-08 12:19:47'),
(4, 1, 'Project 4', '50', 'thumbnail_1672880567.jpg', 2, 'project-4', 1300000, 'active', 1, 2, 2, NULL, NULL, 'A floor plan is a drawing or a visual representation of a home’s interior from above. It shows the placement of walls and includes key elements of the house like doors, windows, stairs, and furniture. It also communicates the room names and sizes, as well as the dimensions between walls.\r\nNote - Total Square Footage typically only includes conditioned space and does not include garages, porches, bonus rooms, or decks', '2023-01-04 17:00:25', '2023-01-08 14:48:45'),
(5, 1, 'Project 5', '50', 'thumbnail_1673193236.jpg', 2, 'project-5', 1300000, 'active', 2, 1, 2, NULL, NULL, 'A floor plan is a drawing or a visual representation of a home’s interior from above. It shows the placement of walls and includes key elements of the house like doors, windows, stairs, and furniture. It also communicates the room names and sizes, as well as the dimensions between walls. Note - Total Square Footage typically only includes conditioned space and does not include garages, porches, bonus rooms, or decks', '2023-01-04 21:23:25', '2023-01-10 11:12:26'),
(6, 1, 'Project 6', '50', 'thumbnail_1673194246.jpg', 2, 'project-6', 1400000, 'active', 2, 2, 2, NULL, NULL, 'A floor plan is a drawing or a visual representation of a home’s interior from above. It shows the placement of walls and includes key elements of the house like doors, windows, stairs, and furniture. It also communicates the room names and sizes, as well as the dimensions between walls. Note - Total Square Footage typically only includes conditioned space and does not include garages, porches, bonus rooms, or decks', '2023-01-08 08:09:03', '2023-01-08 16:12:58'),
(13, 1, 'Skillion Roof 1', '50', 'thumbnail_1673370797.jpg', 1, 'skillion-roof-1', 78000, 'active', NULL, NULL, NULL, NULL, 'skillion_roof', 'Skillion roofs differ from other standard roofs in that they only have a single flat surface, as opposed to having two sloping sides which meet in a ridge or peak in the centre of a building. The difference between a standard flat roof and a skillion roof, however, lies in the steepness and pitch.', '2023-01-10 02:08:28', '2023-01-10 17:13:30'),
(15, 1, 'Flat Roof 1', '50', 'thumbnail_1673370881.jpg', 1, 'flat-roof-1', 64000, 'active', NULL, NULL, NULL, NULL, 'flat_roof', 'A flat roof is a roof which is almost level in contrast to the many types of sloped roofs. The slope of a roof is properly known as its pitch and flat roofs have up to approximately 10°. Flat roofs are an ancient form mostly used in arid climates and allow the roof space to be used as a living space or a living roof.', '2023-01-10 02:42:24', '2023-01-10 17:14:41'),
(16, 1, 'Gable Roof 1', '50', 'thumbnail_1673370955.jpg', 1, 'gable-roof-1', 80000, 'active', NULL, NULL, NULL, NULL, 'gable_roof', 'A gable roof is a roof consisting of two sections whose upper horizontal edges meet to form its ridge. The most common roof shape in cold or temperate climates, it is constructed of rafters, roof trusses or purlins. The pitch of a gable roof can vary greatly.', '2023-01-10 02:55:25', '2023-01-10 17:15:55'),
(17, 1, 'Pyramid Roof 1', '50', 'thumbnail_1673371042.jpg', 1, 'pyramid-roof-1', 85000, 'active', NULL, NULL, NULL, NULL, 'pyramid_roof', 'A pyramid roof is a type of hip roof that has four sides that are all triangle shaped and all slope downward. They are built onto a square or rectangular frame. Pyramid roofs are a popular choice for a shed, gazebos, and summerhouses as they are a modern eye-catcher and definitely stand out from other roof types.', '2023-01-10 03:14:01', '2023-01-10 17:17:22'),
(20, 1, 'Concrete Wall Fence 1', '70', 'thumbnail_1673371115.jpg', 1, 'concrete-wall-fence-1', 75000, 'active', NULL, NULL, NULL, 'concrete_wall_fence', NULL, 'These are walls made of brick or cement blocks held together with cement mortar and are often plastered with cement plaster on both surfaces. Cement blocks can also be called Concrete Masonry Units or CMUs, and come in a variety of types, including. Solid Concrete Blocks.', '2023-01-10 06:49:18', '2023-01-10 17:18:35'),
(21, 1, 'Cyclone Wire Fence (5\' Height)', '70', 'thumbnail_1673371504.jpg', 1, 'cyclone-wire-fence-5-height', 45000, 'active', NULL, NULL, NULL, NULL, NULL, 'Cyclone fences are made from galvanized or coated steel wire, with each wire bent to zig-zag with the wires on either side of it. They are also commonly referred to as wire-mesh fencing, diamond-mesh fencing, or wire netting.', '2023-01-10 06:55:51', '2023-01-10 17:25:04'),
(22, 1, 'Concrete Wall Fence', '100', NULL, 1, 'concrete-wall-fence', 0, 'inactive', NULL, NULL, NULL, 'concrete_wall_fence', NULL, 'bhbhhb', '2023-01-10 22:34:09', '2023-01-11 06:34:09'),
(23, 1, 'Test Project', '50', NULL, 1, 'test-project', 0, 'inactive', 1, 1, NULL, NULL, NULL, 'hjdjdhjdcbkbcc', '2023-01-22 17:35:54', '2023-01-23 01:35:54'),
(24, 3, 'test1', NULL, NULL, 1, 'test1', 0, 'active', 23, 23, NULL, 'wood_fence', 'hip_roof', 'test1', '2023-03-03 21:04:38', '2023-03-09 04:11:45');

